pragma solidity 0.8.9;
// ROCNFTDepositV2 contract
contract ROCNFTDepositV2 is IROCNFTDepositV2, TwoProfitReceiverRescue, Pausable {

    event NFTDeposited(
        address indexed _fromWallet,
        uint128 indexed _userId,
        uint256[] _nftTokenIds
    );

    IERC1155 public rocNFT;
    address public nftWalletAddress;

    constructor(address payable _profitReceiver1, address payable _profitReceiver2, IERC1155 _rocNFT, address _nftWalletAddress)
            TwoProfitReceiverRescue(_profitReceiver1, _profitReceiver2) {
        rocNFT = _rocNFT;
        nftWalletAddress = _nftWalletAddress;
    }

    function pause() public onlyOwner {
        _pause();
    }

    function unpause() public onlyOwner {
        _unpause();
    }

    // deposit by transfer batch to this bridge contract
    function deposit(
        uint128 _targetUserId,
        uint256[] calldata _ids,
        uint256[] calldata _amounts
    ) external override whenNotPaused {
        require(_targetUserId > 0, "ROCNFTDepositV2: targetUserId must be greater than 0");
        require(_ids.length == _amounts.length, "ROCNFTDepositV2: ids and values must have the same length");
        require(_ids.length > 0, "ROCNFTDepositV2: ids and values must have at least one element");
        for(uint inx=0; inx < _ids.length; inx++) {
            require(_amounts[inx] == 1, "ROCNFTDepositV2: amounts must be 1");
        }
        rocNFT.safeBatchTransferFrom(msg.sender, nftWalletAddress, _ids, _amounts, "");
        emit NFTDeposited(msg.sender, _targetUserId, _ids);
    }
}
